import React, { Component } from "react";
import HeaderNav from "../components/HeaderNav";
import PageTitle from "../components/PageTitle";
import IconRow from "../components/IconRow";
import Project from "../components/Project";

class Interests extends Component {
  state = {
    profileDisplay: false
  };
  render() {
    const interests = [
      { icon: "crossword", description: "I love NYT crosswords!" },
      { icon: "notredame" },
      { icon: "guitar" },
      { icon: "songwriting" },
      { icon: "basketball" }
    ];
    return (
      <div>
        <HeaderNav selected={"Interests"} />
        <section className={`page interests-page flex-row`}>
          <div className="flex-column page-main">
            <PageTitle pageName="Interests" />
            <IconRow
              numRows={1}
              size={"70"}
              icons={interests.map(interest => interest.icon)}
              circle={true}
            />
          </div>
        </section>
      </div>
    );
  }
}
export default Interests;
